import React from 'react';
import defaultImg from '../Utility/defaultImg.jpg';
const PokemonThumb = ({ key, image }) => {
    return (
        <div className='inline'>
            <img src={image} alt={defaultImg} className='inline' />
            {key}
        </div>
    )
}

export default PokemonThumb;
